import "./App.css";
import Header from "./components/Header";
import Post from "./components/Post";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <Routes>
      <Route
        index
        element={
          <main>
            <Header />
            <Post />
          </main>
        }
      />
      <Route path={"/login"} element={<div>login</div>} />
    </Routes>
  );
}

export default App;
